const youtuber = 'Captain';
const favprog = 'Ragnamod';

function App() {
  return (
  <>
    <ul>
        <li>list of yt:</li>
        <li>{youtuber}</li>
        <li>{favprog}</li>
        <li>{myName()}</li>
        <li>{myNames()}</li>
    </ul>
</>);
}

export default App;

function myName() {
  let name = 'Dsev'
  return ( name );
}

function myNames() {
  let names = 'Dev'
  return ( names );
}

export {youtuber, favprog, myName, myNames};
